

CREATE TABLE IF NOT EXISTS `alumnos` (
  `id` int NOT NULL AUTO_INCREMENT,
  `codigo` varchar(6) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `dni` varchar(8) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `paterno` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `materno` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `nombres` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `email` varchar(80) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `celular` varchar(9) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `modalidad` varchar(80) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `programa_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1736 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE IF NOT EXISTS `asistencia` (
  `id` int NOT NULL AUTO_INCREMENT,
  `dni` varchar(50) COLLATE utf8mb4_general_ci NOT NULL,
  `estado` int DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE IF NOT EXISTS `ganadores` (
  `id` int NOT NULL AUTO_INCREMENT,
  `dnig` varchar(8) COLLATE utf8mb4_general_ci NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


CREATE TABLE IF NOT EXISTS `program` (
  `prog_id` int NOT NULL AUTO_INCREMENT,
  `id_facu` varchar(7) DEFAULT NULL,
  `programa` varchar(51) DEFAULT NULL,
  `facultad` varchar(50) DEFAULT NULL,
  `id_escu` varchar(7) DEFAULT NULL,
  `escuela` varchar(36) DEFAULT NULL,
  `username` varchar(23) DEFAULT NULL,
  `password` varchar(8) DEFAULT NULL,
  `status` varchar(6) DEFAULT NULL,
  PRIMARY KEY (`prog_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=102 DEFAULT CHARSET=utf8mb3;


CREATE TABLE IF NOT EXISTS `salida` (
  `id` int NOT NULL AUTO_INCREMENT,
  `dnisalida` varchar(8) COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


